import React from 'react';
import './AnimalDetails.css'

const AnimalDetails = ({Animal}) => {
    console.log(Animal)
    return (
        <div>

            <img className="image" src={Animal.src}/>
            {Animal.facts.map(d => (
                <p>{d}</p>
            ))}
            <h1>{Animal.name}</h1>
            <h2>{Animal.age}</h2>

        </div>
    )
}

export default AnimalDetails;
